import Video from "./Video";

const ModalApp = () => {
  state = {
    abierto: false,
  };

  const cerrarModal = () => {
    this.setState({ abierto: !this.state.abierto });
  };

  return (
    <div isOpen={this.state.abierto}>
      <div className="overlay">
        <div className="popup">
          <button onClick={cerrarModal}>Cerrar</button>
          <Video />
        </div>
      </div>
    </div>
  );
};
export default ModalApp;
